         margin: 10px 40px 40px 40px;
     }
     .demo2{
         width: 480px;
           height: 260px;
           border: 1px solid black;
         float:right;
         line-height: 1.2;
         padding:3px;

     }.demo2 label{
         margin: 10px 40px 40px 40px;
     }
     .demo3{
         width: 300px;
           height: 109px;
           border: 1px solid black;
         padding: 3px;
         box-sizing: border-box;
         float:left;
         position:relative; left:10px; 
     }
     .demo3label{
     float:left;
     }
     .demo4{
         width: 850px;
         height: 365px;
         border: 1px solid black;
         padding: 3px;
         line-height: 0.5;
         float:right;
         position:relative; left:35px; top:47px;
     }.demo4 label{
         margin: 10px 45px 30px 45px;
     }

  </style>
</head>
